import React from 'react';
function Home() {
  return (
    <div className="home-page">
      <div className="account-modal-content">
        <span>
          <i className="fa-solid fa-fingerprint user-fingerprint"></i>
        </span>
        <button>Log In</button>
        <button>New User? Sign Up</button>
      </div>
    </div>
  );
}

export default Home;
